import React from 'react';
import styled from "@emotion/styled";

const Cotizacion = ({resultado}) => {
    if(Object.keys(resultado).length === 0) return null;
    console.log(resultado)

    return (
       <ResultadoDiv>
            <Logo src={	`https://www.cryptocompare.com/${resultado.IMAGEURL}`}></Logo>
            <Precio>El precio es: <span>{resultado.PRICE}</span> </Precio>
            <Info>Precio más alto del día: <span>{resultado.HIGHDAY}</span> </Info>
            <Info>Precio más bajo del día: <span>{resultado.LOWDAY}</span> </Info>
            <Info>Variación últimas 24 horas: <span>{resultado.CHANGEPCT24HOUR}</span> </Info>
            <Info>Última Actualización: <span>{resultado.LASTUPDATE}</span> </Info>
       </ResultadoDiv>
    );
}

export default Cotizacion

const ResultadoDiv = styled.div`
    color: #FFF;
    font-family: Arial, Helvetica, sans-serif;
    display: flex;
    justify-content: center;
`;

const Info = styled.p`
    font-size: 20px;
    display: flex;
    justify-content: space-evenly;
    span {
        font-weight:bold;
    }
`;
const Precio = styled.p`
    font-size: 20px;
    span {
        font-weight:bold;
    }
`

const Logo = styled.img`
    max-height: 40px;
`
